import { Outlet } from 'react-router-dom';
import {Create, SideMenu} from "./index";

const Layout = () => {
    return (
            <main className="App">
                <SideMenu/>
                <Create/>
                <div>
                    <Outlet />
                </div>
            </main>
    )
}

export default Layout
